import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
// import store from './store'
import HighChartsTheme from ""
createApp(App)
// .use(store)
.use(router)
.use()
.mount('#app')

global.jQuery = require('jquery');
var $ = global.jQuery;
window.$ = $;
